from typing import List

class Solution:
    def findPrimePairs(self, n: int) -> List[List[int]]:
        def sieve(n):
            prime = [True for _ in range(n+1)]
            p = 2
            while (p * p <= n):
                if (prime[p] == True):
                    for i in range(p * p, n+1, p):
                        prime[i] = False
                p += 1
            return [p for p in range(2, n) if prime[p]]

        primes = sieve(n)
        prime_pairs = []
        i, j = 0, len(primes) - 1
        while i <= j:
            if primes[i] + primes[j] == n:
                prime_pairs.append([primes[i], primes[j]])
                i += 1
                j -= 1
            elif primes[i] + primes[j] < n:
                i += 1
            else:
                j -= 1

        return prime_pairs
